import React from 'react';



class Nav  extends React.Component {


    render() { 
        return ( 
<div className="Navigation">
<nav className="nav">
  <ul className="list">
   <li><a href="">About</a></li>
   <li><a href="">Gallery</a></li>
   <li><a href="">Contact</a></li>
  </ul>
</nav>
    
        </div>
        );
    }
}
export default Nav ;
